import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

export type PostsType = {
    id: number
    message: string
    likesCount: number
}

export type DialogsType = {
    id: number
    name: string
}

export type MessagesType = {
    id: number
    message: string
}

let posts: Array<PostsType> = [
    {id: 1, message: 'Hi, how are you', likesCount: 12},
    {id: 2, message: 'Its my first Post', likesCount: 28},
    {id: 3, message: 'Whats your name', likesCount: 57}
]

let dialogs: Array<DialogsType> = [
    {id: 1, name: 'Alex'},
    {id: 2, name: 'Serg'},
    {id: 3, name: 'Nata'},
    {id: 4, name: 'Lena'},
    {id: 5, name: 'Andrey'},
    {id: 1, name: 'Sasha'},
]

let messages: Array<MessagesType> = [
    {id: 1, message: 'Hi'},
    {id: 1, message: 'How are you'},
    {id: 1, message: 'Yo'},
    {id: 1, message: 'LOL'},
]

ReactDOM.render(
    <App
        posts = {posts}
        dialogs = {dialogs}
        messages = {messages}
    />,
  document.getElementById('root')
);
